import React, { Component } from 'react';

import './Menu.css';

class Menu extends Component {
  render() {
    return (
      <nav className="navbar" role="navigation" aria-label="main navigation">
        <div className="navbar-brand">
          a
        </div>
        <div className="navbar-menu">
          a
        </div>
      </nav>
    );
  }
}

export default Menu;
